import React, { Component } from 'react';

class Schedule extends Component {
    render() {
        return (
            <div id="main">
				<div id="content">
					<section>
						<div className="container">
							<h3>Schedule Now</h3>
						</div>
					</section>
				</div>
			</div>
        );
    }
}

export default Schedule;
